import React, { Component } from "react";
import Modal from 'react-bootstrap/Modal'
import Button from "react-bootstrap/Button";

export default class PopUp extends Component {
  handleClick = () => {
	this.props.toggle();
  };
  render() {
		return (
            <div className="modal">
                <div className="modal_content">
                    <Modal show={true} onHide={this.handleClick} backdrop="static">
                        <Modal.Header closeButton>
                            <Modal.Title>'s Profile</Modal.Title>
                            </Modal.Header>
                            <form style={{paddingLeft:"1%"}}>First name: </form>
                            <form style={{paddingLeft:"1%"}}>Last name:</form>
                            <form style={{paddingLeft:"1%"}}>Email: </form>
                            <form style={{paddingLeft:"1%"}}>Join date: </form>
                            <Modal.Footer>
                            <Button variant="primary" onClick={this.handleClick}>
                                Close
                            </Button>
                        </Modal.Footer>
                    </Modal>
                </div>
            </div>
		);
	  }
}
